classitems.description:
Alarm.
Possible actions:
- Simplest that works:
  window.location = alarmUrl;
- Will be blocked as pop-up:
  window.open(alarmUrl, '_blank');
- Needs same origin:
  var iframe = document.getElementById("alarm-iframe");
  iframe.src = alarmUrl;

